#include <vector>
#include <queue>
using namespace std;
int ii[] = {-1, 1, 0, 0};
int jj[] = {0, 0, -1, 1};
class Solution {
public:
    int nearestExit(vector<vector<char>>& maze, const vector<int>& entrance) {
        int m = maze.size();
        int n = maze[0].size();
        // cout << "m: " << m << "n: " << n << endl;
        queue<pair<pair<int,int>,int>> q;
        // vector<vector<int>> vis()
        q.push(make_pair(make_pair(entrance[0],entrance[1]),0));
        maze[entrance[0]][entrance[1]] = '+';
        while (!q.empty()) {
            auto pos_n_step = q.front();
            q.pop();
            int n_step = pos_n_step.second;
            int i = pos_n_step.first.first;
            int j = pos_n_step.first.second;
            cout << i << " " << j << endl;
            
            if (i == 0 || i == m-1 || j == 0 || j == n-1) {
                if (i != entrance[0] || j != entrance[1]) {
                    return n_step;
                }
            }
            for (int k = 0; k < 4; k++) {
                int next_i = i+ii[k];
                int next_j = j+jj[k];
                if (next_i < 0 || next_i >= m || next_j < 0 || next_j >= n || maze[next_i][next_j] != '.') {
                    continue;
                }
                
                q.push(make_pair(make_pair(next_i,next_j),n_step+1));
                maze[i][j] = '+';
            }
        }
        return -1;
    }
};

